INSERT INTO `fman_matches` VALUES ('14','1552751928','tm','1','1','Juventus','27','FC Liverpool','6','2','3','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>John Champion</b> va sherigim <b>Jimmy Beglin</b> menejer.cf saytida, <b>Juventus - FC Liverpool</b> o`yinini sharxlab boramiz. Torino shahridagi <b>Juventus Stadium</b> stadionida  <b>7968</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. Juventus: 4-4-2. Asosiy tarkibdagilar: Wojsiezch Szchesny - Alex Sandro, Giorgio Chiellini, Medhi Benatia, Patrice Evra - Sami Khedira, Miralem Pjanic, Douglas Costa, Mario Mandzukic - Cristiano Ronald0, Paulo Dybala.FC Liverpool klubining taktik sxemasi: 4-3-3. Asosiy tarkibda: Allison - Alberto Moreno, Martin Skrtel, Dejan Lovren, Nathaniel Clyne - James Milner, Jordan Henderson, Adam Lallana - Roberto Firmino, Mohammed Salah, Sadio Mane. Mehmon klubning bugungi o`yinga tanlagan taktikasi: qanotlardan hujum.|1|','8|Juventus klubi chap qanotdan hujum boshladi. Patrice Evra Adam Lallanani alday olmadi va to`pni yo`qotdi, natijada FC Liverpool klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p James Milnerga uzatildi. Ammo u ikkinchi qavatda Alex Sandro bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','14|FC Liverpool klubi markazdan hujum boshladi. Jordan Henderson  Miralem Pjanicni aldab o`tdi  va to`pni Roberto Firminoga uzatdi.Yo`q yo`q bu qanday qilib??? U o`z oyoqlariga elakishib qoldi va Medhi Benatia  undan to`pni olib qo`ydi.|1|','27|Juventus klubi markazdan hujum boshladi. Miralem Pjanic Jordan Henderson bilan kurashda yutqazdi va to`pni yo`qotdi, natijada FC Liverpool klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Mohammed Salahga uzatildi. Va bu GOOOL! U to`pni qabul qildi va uzoqdan zarba berdi. To`p raqib darvozasiga to`singa tegib kirdi. 0-1|2|Mohammed Salah|99|6','30|FC Liverpool klubi o`ng qanotdan hujum boshladi. Alberto Moreno Sami Khedirani alday olmadi va to`pni yo`qotdi, natijada Juventus klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Paulo Dybalaga uzatildi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','44|Juventus klubi chap qanotdan hujum boshladi. Patrice Evra Adam Lallana bilan kurashda yutqazdi va to`pni yo`qotdi, natijada FC Liverpool klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Sadio Manega uzatildi. Ammo u ikkinchi qavatda Alex Sandro bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','53|FC Liverpool klubi o`ng qanotdan hujum boshladi. Alberto Moreno  Sami Khedirani aldab o`tdi  va to`pni Sadio Manega uzatdi. GOOOOOL!!!! U ikkinchi qavatda Alex Sandro bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 0-2|2|Sadio Mane|94|6','59|Juventus klubi chap qanotdan hujum boshladi. Patrice Evra  Adam Lallanani aldab o`tdi  va to`pni Cristiano Ronald0ga uzatdi. Ammo u ikkinchi qavatda Nathaniel Clyne bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','65|FC Liverpool klubi o`ng qanotdan hujum boshladi. Alberto Moreno  Sami Khedirani aldab o`tdi  va to`pni Sadio Manega uzatdi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 0-3|2|Sadio Mane|94|6','79|Juventus klubi o`ng qanotdan hujum boshladi. Alex Sandro  James Milnerni aldab o`tdi  va to`pni Sami Khediraga uzatdi. GOOOOOL!!!! U ikkinchi qavatda Alberto Moreno bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 1-3|2|Sami Khedira|596|27','82|FC Liverpool klubi chap qanotdan hujum boshladi. Nathaniel Clyne Mario Mandzukicni alday olmadi va to`