INSERT INTO `fman_matches` VALUES ('16','1552752194','tm','1','1','Real Madrid CF','41','Paris Saint-Germain','64','3','1','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>John Champion</b> va sherigim <b>Jimmy Beglin</b> menejer.cf saytida, <b>Real Madrid CF - Paris Saint-Germain</b> o`yinini sharxlab boramiz. Madrid shahridagi <b>Santiago Bernabeu</b> stadionida  <b>5103</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. Real Madrid CF: 3-5-2. Asosiy tarkibdagilar: Keylor Navas - Marcelo, Raphael Varane, Sergio Ramos - Gareth Bale, Lucas Vazquez, Vinicius Junior, Toni Kroos, Marcos Llorente - Borja Mayoral, Karim Benzema. Mezbonlarning taktikasi: markazdan hujum.Paris Saint-Germain klubining taktik sxemasi: 4-3-3. Asosiy tarkibda: Gianluigi Buffon - Daniel Alves, Thiago Silva, Lassana Diarra, Layvin Kurzawa - Christophe Jallet, Yohan Cabaye, Angel Di Maria - Neymar Junior, Edinson Cavani, Kylian Mbappe. Mehmon klubning bugungi o`yinga tanlagan taktikasi: pressing.|1|','9|Real Madrid CF klubi o`ng qanotdan hujum boshladi. Marcelo Christophe Jallet bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Neymar Juniorga uzatildi. Ammo u ikkinchi qavatda Lucas Vazquez bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','10|Paris Saint-Germain klubi o`ng qanotdan hujum boshladi. Daniel Alves  Gareth Baleni aldab o`tdi  va to`pni Christophe Jalletga uzatdi. Ammo u ikkinchi qavatda Marcelo bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','24|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabaye bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Christophe Jalletga uzatildi. GOOOOOL!!!! U ikkinchi qavatda Marcelo bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 0-1|2|Christophe Jallet|1540|64','28|Paris Saint-Germain klubi markazdan hujum boshladi. Yohan Cabaye Lucas Vazquez bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Real Madrid CF klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Karim Benzemaga uzatildi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 1-1|2|Karim Benzema|1000|41','38|Real Madrid CF klubi o`ng qanotdan hujum boshladi. Marcelo Christophe Jalletni alday olmadi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Angel Di Mariaga uzatildi. Ammo u ikkinchi qavatda Raphael Varane bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','54|Paris Saint-Germain klubi markazdan hujum boshladi. Yohan Cabaye  Lucas Vazquezni aldab o`tdi  va to`pni Kylian Mbappega uzatdi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','56|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabaye bilan kurashda yutib chiqdi  va to`pni Vinicius Juniorga uzatdi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 2-1|2|Vinicius Junior|992|41','68|Paris Saint-Germain klubi o`ng qanotdan hujum boshladi. Daniel Alves Gareth Bale bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Real Madrid CF klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Marcos Llorentega uzatildi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','78|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabaye bilan kurashda yutqazd