INSERT INTO `fman_matches` VALUES ('17','1552752408','tm','1','1','FC Arsenal','4','AC Milan','21','3','3','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>John Champion</b> va sherigim <b>Jimmy Beglin</b> menejer.cf saytida, <b>FC Arsenal - AC Milan</b> o`yinini sharxlab boramiz. London shahridagi <b>Emirates Stadium</b> stadionida  <b>8315</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. FC Arsenal: 4-4-2. Asosiy tarkibdagilar: Petr Cech - Lichsteiner, Popastapopulas, Skodran Mustafi, Hector Bellerin - Henrikh Mkhitaryan, Lucas Torreiro, Aaron Ramsey, Alexander Lacazette - Aubameyang, Mesut Ozil. Mezbonlarning taktikasi: qanotlardan hujum.AC Milan klubining taktik sxemasi: 3-5-1. Asosiy tarkibda: Gianluigi Donnaruma - Gustavo Gomez, Ignazio Abate, Rodrigo Ely - Manuel Locatelli, Andrea Bertolacci, Andrea Poli, MBaye Niang, Manuel  - Carlos Bacca.|1|','4|FC Arsenal klubi chap qanotdan hujum boshladi. Hector Bellerin  MBaye Niangni aldab o`tdi  va to`pni Mesut Ozilga uzatdi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 1-0|2|Mesut Ozil|64|4','11|AC Milan klubi markazdan hujum boshladi. Manuel Locatelli  Lucas Torreironi aldab o`tdi  va to`pni Carlos Baccaga uzatdi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Popastapopulasdan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  1-1|2|Carlos Bacca|452|21','23|FC Arsenal klubi markazdan hujum boshladi. Lucas Torreiro  Andrea Polini aldab o`tdi  va to`pni Aubameyangga uzatdi. Va bu GOOOL! U to`pni qabul qildi va uzoqdan zarba berdi. To`p raqib darvozasiga to`singa tegib kirdi. 2-1|2|Aubameyang|67|4','36|AC Milan klubi markazdan hujum boshladi. Andrea Poli Lucas Torreiro bilan kurashda yutqazdi va to`pni yo`qotdi, natijada FC Arsenal klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Alexander Lacazettega uzatildi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Gustavo Gomezdan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  3-1|2|Alexander Lacazette|66|4','41|FC Arsenal klubi chap qanotdan hujum boshladi. Hector Bellerin  MBaye Niangni aldab o`tdi  va to`pni Aubameyangga uzatdi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','51|AC Milan klubi o`ng qanotdan hujum boshladi. Gustavo Gomez Henrikh Mkhitaryanni alday olmadi va to`pni yo`qotdi, natijada FC Arsenal klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Alexander Lacazettega uzatildi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','60|FC Arsenal klubi markazdan hujum boshladi. Lucas Torreiro Andrea Polidan tezlikda qolib ketdi va to`pni yo`qotdi, natijada AC Milan klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Carlos Baccaga uzatildi. GOOOOOL!!!! U ikkinchi qavatda Lichsteiner bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 3-2|2|Carlos Bacca|452|21','68|AC Milan klubi o`ng qanotdan hujum boshladi. Gustavo Gomez  Henrikh Mkhitaryanni aldab o`tdi  va to`pni Carlos Baccaga uzatdi. Ammo u ikkinchi qavatda Lichsteiner bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','81|FC Arsenal klubi markazdan hujum boshladi. Lucas Torreiro Andrea Polini alday olmadi va to`pni yo`qotdi, natijada AC Milan klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p MBaye Niangga uzatildi. GOOOOOL!!!! U ikkinchi qavatda Popastapopulas bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 3-3|2|MBaye Niang|447|21','90|AC Milan klubi markazdan hujum boshladi. Manuel Locatelli Lucas Torreironi alday olmadi va to`pni yo`qotdi, natijada FC Arsenal klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Aaron Ramseyga uzatildi.Ammo u to`pni yaxshi qabullay olmadi va Gustavo Gomez undan to`pni olib qo`ydi.|1|','90|Final hushtagi yangradi match 3-3 hisobi bilan yakunlandi.|1|',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','0','0');
