INSERT INTO `fman_matches` VALUES ('2073','1552764600','B','0','1','Real madrid cf','41','Paris saint-germain','64','5','1','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>Beruniy </b> o`yinini sharxlab boraman. Madrid shahridagi <b>Santiago Bernabeu</b> stadionida  <b>20000</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. Real madrid cf: 3-5-2. Asosiy tarkibdagilar: Keylor Navas - Marcelo, Raphael Varane, Sergio Ramos - Gareth Bale, Lucas Vazquez, Vinicius Junior, Toni Kroos, Marcos Llorente - Borja Mayoral, Karim Benzema. Mezbonlarning taktikasi: markazdan hujum.Paris saint-germain klubining taktik sxemasi: 4-3-3. Asosiy tarkibda: Gianluigi Buffon - Daniel Alves, Thiago Silva, Lassana Diarra, Layvin Kurzawa - Christophe Jallet, Yohan Cabaye, Angel Di Maria - Gabriel Jesus, Edinson Cavani, Kylian Mbappe. Mehmon klubning bugungi o`yinga tanlagan taktikasi: pressing.|1|','5|Real Madrid CF klubi chap qanotdan hujum boshladi. Sergio Ramos Angel Di Maria bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Edinson Cavaniga uzatildi. GOOOOOL!!!! U ikkinchi qavatda Marcelo bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 0-1|2|Edinson Cavani|1545|64','16|Paris Saint-Germain klubi chap qanotdan hujum boshladi. Layvin Kurzawa Marcos Llorente bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Real Madrid CF klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Karim Benzemaga uzatildi.Yo`q yo`q bu qanday qilib??? U o`z oyoqlariga elakishib qoldi va Thiago Silva  undan to`pni olib qo`ydi.|1|','21|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabayedan tezlikda o`tib ketdi  va to`pni Karim Benzemaga uzatdi. GOOOOOL!!!! U ikkinchi qavatda Thiago Silva bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 1-1|2|Karim Benzema|1000|41','28|Paris Saint-Germain klubi markazdan hujum boshladi. Yohan Cabaye Lucas Vazquez bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Real Madrid CF klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Karim Benzemaga uzatildi. GOOOOOL!!!! U ikkinchi qavatda Layvin Kurzawa bilan o`ynadi va to`pni raqib darvozabon yoniga yo`lladi. Darvozabon to`p yo`nalishini topa oldi, ammo darvozabonning barmoqlarining uchi gina to`pga tegdi. 2-1|2|Karim Benzema|1000|41','42|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabaye bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Christophe Jalletga uzatildi. Ammo u ikkinchi qavatda Sergio Ramos bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','50|Paris Saint-Germain klubi markazdan hujum boshladi. Yohan Cabaye Lucas Vazquez bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Real Madrid CF klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Karim Benzemaga uzatildi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Lassana Diarradan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  3-1|2|Karim Benzema|1000|41','61|Real Madrid CF klubi markazdan hujum boshladi. Lucas Vazquez Yohan Cabaye bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Angel Di Mariaga uzatildi. Ammo u ikkinchi qavatda Sergio Ramos bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','65|Paris Saint-Germain klubi markazdan hujum boshladi. Yohan Cabaye Lucas Vazquezni 