INSERT INTO `fman_matches` VALUES ('2120','1552765200','B','0','0','Manchester city','3','Real madrid cf','41','1','0','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>Beruniy </b> o`yinini sharxlab boraman. Manchester shahridagi <b>Etihad Stadium</b> stadionida  <b>20000</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. Manchester city: 4-4-2. Asosiy tarkibdagilar: Ederson - Benjamin Mendy, John Stones, Vincent  Kompany, Emerick Laporte - Raheem Sterling, Riyad Mahrez, Leroy Sane, Kevin De Bruyne - Sergio Aguero, Neymar Junior. Mezbonlarning taktikasi: kontrataka.Real madrid cf klubining taktik sxemasi: 3-5-2. Asosiy tarkibda: Keylor Navas - Marcelo, Raphael Varane, Sergio Ramos - Gareth Bale, Lucas Vazquez, Vinicius Junior, Toni Kroos, Marcos Llorente - Borja Mayoral, Karim Benzema. Mehmon klubning bugungi o`yinga tanlagan taktikasi: markazdan hujum.|1|','5|Manchester City klubi markazdan hujum boshladi. Riyad Mahrez Lucas Vazquezdan tezlikda o`tib ketdi  va to`pni Neymar Juniorga uzatdi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Raphael Varanedan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  1-0|2|Neymar Junior|1548|3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Eu',NULL,'0','0','0','0','0');
