INSERT INTO `fman_matches` VALUES ('2122','1552765200','B','0','0','Fc everton','7','Paris saint-germain','64','2','2','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>Beruniy </b> o`yinini sharxlab boraman. Liverpool shahridagi <b>Craven Cottage</b> stadionida  <b>20000</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. Fc everton: 3-5-1. Asosiy tarkibdagilar: Jordan Pickford - Brandon Galloway, Jonjoe Kenny, Yerry Mina - Cenk Tosun, James McCarthy, Bernard Anicio, Andre Gomes, Gylfi Sigurdsson - Tom Davies.Paris saint-germain klubining taktik sxemasi: 4-3-3. Asosiy tarkibda: Gianluigi Buffon - Daniel Alves, Thiago Silva, Lassana Diarra, Layvin Kurzawa - Christophe Jallet, Yohan Cabaye, Angel Di Maria - Gabriel Jesus, Edinson Cavani, Kylian Mbappe. Mehmon klubning bugungi o`yinga tanlagan taktikasi: pressing.|1|','1|FC Everton klubi markazdan hujum boshladi. Cenk Tosun Yohan Cabayeni alday olmadi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Gabriel Jesusga uzatildi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Brandon Gallowaydan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  0-1|2|Gabriel Jesus|51|64','16|Paris Saint-Germain klubi chap qanotdan hujum boshladi. Layvin Kurzawa Andre Gomesni alday olmadi va to`pni yo`qotdi, natijada FC Everton klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p James McCarthyga uzatildi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 1-1|2|James McCarthy|111|7','27|FC Everton klubi markazdan hujum boshladi. Bernard Anicio Yohan Cabaye bilan kurashda yutqazdi va to`pni yo`qotdi, natijada Paris Saint-Germain klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Edinson Cavaniga uzatildi. Va bu GOOOL! U to`pni qabul qildi va aniq va kuchli zarba yo`lladi. Darvozabon hatto o`rnidan qo`zg`alishga ham ulgurmadi. 1-2|2|Edinson Cavani|1545|64','30|Paris Saint-Germain klubi o`ng qanotdan hujum boshladi. Daniel Alves James McCarthydan tezlikda o`tib ketdi  va to`pni Gabriel Jesusga uzatdi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','42|FC Everton klubi chap qanotdan hujum boshladi. Yerry Mina Angel Di Mariadan tezlikda o`tib ketdi  va to`pni Tom Daviesga uzatdi. Ammo u ikkinchi qavatda Layvin Kurzawa bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','46|Paris Saint-Germain klubi chap qanotdan hujum boshladi. Layvin Kurzawa Andre Gomesni alday olmadi va to`pni yo`qotdi, natijada FC Everton klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Gylfi Sigurdssonga uzatildi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Lassana Diarradan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  2-2|2|Gylfi Sigurdsson|114|7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Eu',NULL,'0','0','0','0','0');
