INSERT INTO `fman_matches` VALUES ('2174','1552759754','tm','1','1','FC Arsenal','4','Juventus','27','2','0','0|Assalomu alaykum qadrli futbol ixlosmandlari, bugun men <b>Beruniy </b> o`yinini sharxlab boraman. London shahridagi <b>Emirates Stadium</b> stadionida  <b>9386</b> tomoshabin yig`ildi. Jamoalarning taktik sxemalari bilan tanishamiz. FC Arsenal: 4-4-2. Asosiy tarkibdagilar: Petr Cech - Lichsteiner, Popastapopulas, Skodran Mustafi, Hector Bellerin - Henrikh Mkhitaryan, Lucas Torreiro, Aaron Ramsey, Alexander Lacazette - Aubameyang, Mesut Ozil. Mezbonlarning taktikasi: qanotlardan hujum.Juventus klubining taktik sxemasi: 4-3-3. Asosiy tarkibda: Wojsiezch Szchesny - Alex Sandro, Giorgio Chiellini, Pepe, Medhi Benatia - Sami Khedira, Miralem Pjanic, Douglas Costa - Mario Mandzukic, Cristiano Ronald0, Paulo Dybala. Mehmon klubning bugungi o`yinga tanlagan taktikasi: qanotlardan hujum.|1|','4|FC Arsenal klubi chap qanotdan hujum boshladi. Hector Bellerin Douglas Costani alday olmadi va to`pni yo`qotdi, natijada Juventus klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Sami Khediraga uzatildi.Ammo u to`pni yaxshi qabullay olmadi va Lucas Torreiro undan to`pni olib qo`ydi.|1|','16|Juventus klubi chap qanotdan hujum boshladi. Medhi Benatia Alexander Lacazetteni alday olmadi va to`pni yo`qotdi, natijada FC Arsenal klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Henrikh Mkhitaryanga uzatildi. Ammo u ikkinchi qavatda Pepe bilan kurashda yutqazdi va to`pni yo`qotdi.|1|','20|FC Arsenal klubi chap qanotdan hujum boshladi. Hector Bellerin  Douglas Costani aldab o`tdi  va to`pni Mesut Ozilga uzatdi.Ammo u to`pni yaxshi qabullay olmadi va Medhi Benatia undan to`pni olib qo`ydi.|1|','31|Juventus klubi chap qanotdan hujum boshladi. Medhi Benatia  Alexander Lacazetteni aldab o`tdi  va to`pni Cristiano Ronald0ga uzatdi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','40|FC Arsenal klubi chap qanotdan hujum boshladi. Hector Bellerin  Douglas Costani aldab o`tdi  va to`pni Mesut Ozilga uzatdi. Va bu GOOOL! U to`pni qabul qildi va uzoqdan zarba berdi. To`p raqib darvozasiga to`singa tegib kirdi. 1-0|2|Mesut Ozil|64|4','52|Juventus klubi chap qanotdan hujum boshladi. Medhi Benatia Alexander Lacazetteni alday olmadi va to`pni yo`qotdi, natijada FC Arsenal klubida qarshi hujumga chiqish uchun yaxshi imkoniyat paydo bo`ldi. Birnecha tezkor uzatmalardan so`ng to`p Henrikh Mkhitaryanga uzatildi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','62|FC Arsenal klubi markazdan hujum boshladi. Lucas Torreiro  Miralem Pjanicni aldab o`tdi  va to`pni Aubameyangga uzatdi.Ammo u to`pni yaxshi qabullay olmadi va Pepe undan to`pni olib qo`ydi.|1|','64|Juventus klubi chap qanotdan hujum boshladi. Medhi Benatia  Alexander Lacazetteni aldab o`tdi  va to`pni Douglas Costaga uzatdi. U to`pni qabul qildi va zarbaaa!!! Uuux qanday noaniq... Ehtimol, tomoshabinlar to`pni ushlab olishidan xursand bo`ldi.|1|','80|FC Arsenal klubi o`ng qanotdan hujum boshladi. Lichsteiner  Sami Khedirani aldab o`tdi  va to`pni Aubameyangga uzatdi. GOOOL!!!! U to`pni qabul qildi, takrorlanmas tezlik bilan Alex Sandrodan o`tib ketdi va to`pni raqib darvozasi tomon yo`naltirdi.  2-0|2|Aubameyang|67|4','85|Juventus klubi chap qanotdan hujum boshladi. Medhi Benatia Alexander Lacazettedan tezlikda o`tib ketdi  va to`pni Douglas Costaga uzatdi.Yo`q yo`q bu qanday qilib??? U o`z oyoqlariga elakishib qoldi va Hector Bellerin  undan to`pni olib qo`ydi.|1|','90|Final hushtagi yangradi match 2-0 hisobi bilan yakunlandi.|1|',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','0','0');
